import styled from "styled-components";

export const Wrapper = styled.div`
    background-color: var(--darkGrey)
    width: 100vw;
    height: 300px;
`;

export const Content = styled.div`
width: 100%;

.image_carousel_container {
    width: 100%;

}

.carousel_image {
    background-size: cover;
    background-position: center;

}

`;
